import {RadarChart, Legend, PolarAngleAxis, PolarGrid, Radar, PolarRadiusAxis} from "recharts";

function Performance(){
    const data = [
        {
            value: 80,
            kind: 1
        },
        {
            value: 120,
            kind: 2
        },
        {
            value: 140,
            kind: 3
        },
        {
            value: 50,
            kind: 4
        },
        {
            value: 200,
            kind: 5
        },
        {
            value: 90,
            kind: 6
        }
    ]
    // Rotate radar to start with intensity
    const angleStart = 210

    // Format kind
    const titleKind = {
        cardio: 'Cardio',
        energy: 'Energie',
        endurance: 'Endurance',
        strength: 'Force',
        speed: 'Vitesse',
        intensity: 'Intensité',
    }
    const data1 = [
        {
            "subject": "Math",
            "A": 120,
            "B": 110,
            "fullMark": 150
        },
        {
            "subject": "Chinese",
            "A": 98,
            "B": 130,
            "fullMark": 150
        },
        {
            "subject": "English",
            "A": 86,
            "B": 130,
            "fullMark": 150
        },
        {
            "subject": "Geography",
            "A": 99,
            "B": 100,
            "fullMark": 150
        },
        {
            "subject": "Physics",
            "A": 85,
            "B": 90,
            "fullMark": 150
        },
        {
            "subject": "History",
            "A": 65,
            "B": 85,
            "fullMark": 150
        }
    ]

    return (
        <>
            <RadarChart outerRadius={90} width={730} height={250} data={data1}>
                <PolarGrid />
                <PolarAngleAxis dataKey="subject" />
                <PolarRadiusAxis angle={30} domain={[0, 150]} />
                <Radar name="Mike" dataKey="A" stroke="#8884d8" fill="#ffffff" fillOpacity={0.6} />
                <Radar name="Lily" dataKey="B" stroke="#82ca9d" fill="#ffffff" fillOpacity={0.6} />
                <Legend />
            </RadarChart>
            {/*
                <RadarChart
                    cx="50%"
                    cy="50%"
                    outerRadius="65%"
                    startAngle={angleStart}
                    endAngle={angleStart + 360}
                    data={data}
                >
                    <PolarGrid />
                    <PolarAngleAxis
                        dataKey="kind"

                        tick={{ fill: '#FFFFFF', fontSize: '0.875em'}}
                    />
                    <Radar
                        legendType="none"
                        dataKey="value"
                        stroke="#E60000"
                        fill="#E60000"
                        fillOpacity={0.7}
                    />
                    <Legend />
                </RadarChart>
                */}
        </>
    )
}
export default Performance;
